import React from "react";

function History() {
  return (
    <div className="p-8">
      <h2 className="text-2xl font-bold mb-4">Your Scan History</h2>
      <p className="text-gray-300">This feature will show past uploads and flagged vendor patterns.</p>
    </div>
  );
}

export default History;
